import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import SplitPane from 'react-split-pane';
import Home from './components/home';
import {Listings, userListings} from './components/rentals';
import {Faq, Tnc} from './components/info';

const style = {
    background: '#000',
    width: '2px',
    cursor: 'col-resize',
    margin: '0 5px',
    height: '100%',
};

export default class Nagivator extends Component {
    render() {
        return (
            <Router>
                <SplitPane split="vertical"
                    minSize={100}
                    defaultSize={100}
                    resizerStyle={style}
                >
                    <menu>
                        <div><Link to="/">Home</Link></div>
                        <div><Link to="/rentals/listings">listings</Link></div>
                        <div><Link to="/rentals/userListings">Your Listings</Link></div>
                        <div><Link to="/info/faq">Frequently asked Questions</Link></div>
                        <div><Link to="/info/tnc">Terms and Conditions</Link></div>
                    </menu>
                    <div>
                        <Route exact path="/" Component={Home} />
                        <Route path="rentals/listings" component={listings} />
                        <Route path="rentals/userListings" component={userListings} />
                        <Route path="info/faq" component={Faq} />
                        <Route path="info/tnc" component={Tnc} />

                    </div>

                </SplitPane >
            </Router >
        );
    }
}
